/**
	1-194. Base64 형식 이미지 표시하기
	- 프로그램으로 생성한 이미지데이터 표시
 */
// jpg와 png파일은 바이너리 파일이여서 텍스트 에디터로 열수없지만, Base64를 사용하면 이미지를 문자열 상태로 관리가 가능.
// 자바스크립트는 base64문자열을 사용해 src속성에 해당 문자열을 대입해서 이미지를 표시할수 있다.
// Base64시작 문자열은 'data:image/jpeg;base64' 또는 'data:image/png;base64' 이다. 

const baseImg= document.querySelector('#baseImage');

// base64 형식으로 표현 함
// ex) 이미지 첨부해야 하는경우인데, 서버접근이 불가능한 상황이다? base64인코딩을 통해 데이터로 문자를 변환시켜서 이미지 보여주기
baseImg.src= 'data:image/jpeg;base64,';


